import React, { Component } from "react";

import {Link} from 'react-router-dom';

let data=[{
    name:""
}]

class Picture extends Component{

    StoreName=event =>{
        data[0].name=event.target.value ;
    }
    render(){
        return(
            <div>
                <h1>hi there</h1>
                <label htmlFor="">Donnez votre nom</label>
                <input type="text" onChange={this.StoreName}/>
                <Link to ={{
                    pathname:"input_test",data:data
                }}>Continue</Link>
            </div>
        )
    }
}

export default Picture;
